// VideoList.js
import React from 'react';
import { Link } from 'react-router-dom';

const VideoList = () => {
  const videos = [
    { id: 1, title: 'Getting Started', url: 'https://www.youtube.com/embed/your-video-id-1' },
    { id: 2, title: 'Connecting with Family', url: 'https://www.youtube.com/embed/your-video-id-2' },
    // Add more videos as needed
  ];

  return (
    <div className="video-list">
      <h2>Video Tutorials</h2>
      <ul>
        {videos.map((video) => (
          <li key={video.id}>
            <Link to={`/video-player/${encodeURIComponent(video.url)}`}>{video.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default VideoList;
